    useEffect(()=>{
        fetchAllUsers();
    },[]);

    const fetchAllUsers = () => {
    http.get('/users').then(res=>{
        setUsers(res.data);
    })
    return (
        <div>
            <h2>User Listing</h2>
            <table className="table">
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Email</th>
                        <th>Phone Number</th>
                        </tr>
                </thead>
            </table>
        </div>
    )
}
}
